INSERT INTO resource.resources (name, content, type_id, create_time, update_time, enable, remark, icon) VALUES ('Cloud-Platform', ' https://gitee.com/geek_qi/cloud-platform', 111, '2021-01-30 14:39:12', '2021-01-30 15:31:36', 0, 'Cloud-Platform是国内首个基于Spring Cloud的微服务开发平台，具有统一授权、认证后台管理系统，其中包含具备用户管理、资源权限管理、网关API 管理等多个模块，支持多业务系统并行开发，可以作为后端服务的开发脚手架。代码简洁，架构清晰，适合学习和直接项目中使用', null);
