INSERT INTO resource.resources (name, content, type_id, create_time, update_time, enable, remark, icon) VALUES ('JeeSite', '  https://github.com/thinkgem/jeesite', 111, '2021-01-30 14:45:04', '2021-01-30 15:31:36', 0, 'JeeSite 是一个 Java EE 企业级快速开发平台，基于经典技术组合（Spring Boot、Spring MVC、Apache Shiro、MyBatis、Beetl、Bootstrap、AdminLTE）采用经典开发模式，让初学者能够更快的入门并投入到团队开发中去。在线代码生成功能，包括核心模块如：组织机构、角色用户、菜单及按钮授权、数据权限、系统参数、内容管理、工作流等。采用松耦合设计；界面无刷新，一键换肤；众多账号安全设置，密码策略；在线定时任务配置；支持集群，支持SAAS；支持多数据源；支持微服务', null);
